var box = scene.getObjectByName( 'Box' );
box.scale.multiplyScalar( 0.9 );
scene.remove( box );

var group = new THREE.Group();
group.position.x = - 10;
group.position.z = - 10;
scene.add( group );

for ( var x = 0; x <= 10; x ++ ) {

	for ( var z = 0; z <= 10; z ++ ) {

		var clone = box.clone();
		clone.material = box.material.clone();
		clone.position.x = x * 2;
		clone.position.z = z * 2;
		group.add( clone );

	}

}

function update( event ) {

	var time = event.time * 0.001;

	camera.position.x = Math.sin( time * 0.3 ) * 20;
	camera.position.z = Math.cos( time * 0.3 ) * 20;
	camera.lookAt( new THREE.Vector3( 0, -2, 0 ) );

	var center = new THREE.Vector3( 10, 0, 10 );
	var children = group.children;

	for ( var i = 0; i < children.length; i ++ ) {

		var child = children[ i ];
		child.position.y = Math.sin( time * 1.12 + child.position.x * 0.3 ) + Math.sin( time * 2.23 + child.position.z * 0.3 );
		child.position.y *= Math.pow( 1 - Math.min( 10, child.position.distanceTo( center ) ) / 10, 2 ) * 5;
		child.material.emissive.r = Math.max( 0, child.position.y * 0.15 );
		child.material.emissive.b = Math.max( 0, - child.position.y * 0.15 );

	}


}
